// static
bool UnionTraits<::device::mojom::blink::FingerprintMessage::DataView, ::device::mojom::blink::FingerprintMessagePtr>::Read(
    ::device::mojom::blink::FingerprintMessage::DataView input, ::device::mojom::blink::FingerprintMessagePtr* output)
{
    using UnionType = ::device::mojom::blink::FingerprintMessage;
    using Tag = UnionType::Tag;

    switch (input.tag()) {
    case Tag::kFingerprintError: {
        ::device::mojom::blink::FingerprintError result_fingerprint_error;
        if (!input.ReadFingerprintError(&result_fingerprint_error))
            return false;

        *output = UnionType::NewFingerprintError(result_fingerprint_error);
        break;
    }
    case Tag::kScanResult: {
        ::device::mojom::blink::ScanResult result_scan_result;
        if (!input.ReadScanResult(&result_scan_result))
            return false;

        *output = UnionType::NewScanResult(result_scan_result);
        break;
    }
    default:

        return false;
    }
    return true;
}

